import React, { useState, useEffect } from "react";
import Axios from "axios";
import Select from "react-select";
import { Header } from "./PagesElements";
import "./PagesElements.css";

const Search = () => {
  const [pesel, setPesel] = useState("");
  const [start_date, setStartDate] = useState("");
  const [end_date, setEndDate] = useState("");
  const [product_name, setProductName] = useState("");
  const [prescriptions, setprescriptions] = useState([]);

  const getPrescriptionSearchData = () => {
    Axios.post("http://localhost:8080/api/test3", {
      pesel: pesel,
      startDate: start_date,
      endDate: end_date,
      productName: product_name,
    }).then((res) => {

      console.log(res);
    });
  };
  return (
    <div className="App">
      <Header>Wyszukiwarka Recept</Header>
      <div className="inputsWrapper">
        <div>
          <label>Pesel:</label>
          <input
            type="text"
            name="pesel"
            onChange={(e) => {
              setPesel(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Data od:</label>
          <input
            type="date"
            name="start_date"
            onChange={(e) => {
              setStartDate(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Data do:</label>
          <input
            type="date"
            name="end_date"
            onChange={(e) => {
              setEndDate(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Nazwa Leku:</label>
          <input
            type="text"
            name="product_name"
            onChange={(e) => {
              setProductName(e.target.value);
            }}
          />
        </div>
      </div>

      <button onClick={getPrescriptionSearchData}>
        getPrescriptionSearchData
      </button>
      <table className="styled-table">
        <div className="scrollit">
          <thead>
            <tr>
              <th>Recepty:</th>
            </tr>
          </thead>
          <tbody>{}</tbody>
        </div>
      </table>
    </div>
  );
};

export default Search;
